  componentDidMount(){
    const { getCurrentPlanets } = this.props;
    getCurrentPlanets();
    console.log(getCurrentPlanets);
  }
  render (){
     const { swPlanetss } = this.props
    return(
      <section>
        <div> 
          {swPlanetss.map((swPlanetss)=>
            <p>{swPlanetss.name}</p>
          )}
            </div>
    <div>StarWars Datatable with Filters</div>
    </section>
    )
  }
  }

const mapStateToProps = (state) => ({
  swPlanetss: state.fetchReducer.data,
})
const mapDispatchToProps = (dispatch) => ({
  getCurrentPlanets: () => dispatch
  (fetchPlanets()),
})

ApplicationCache.propTypes = {
  getCurrentPlanets: PropTypes.func.isRequired,
};

